// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "hardhat/console.sol";

contract MarsPair {
    IERC20 public immutable token0;
    IERC20 public immutable token1;
    uint8 public immutable fee; //100 means 1%
    address public immutable feeTo;

    uint48 public count = 0;

    struct Order {
        //uses single storage slot
        //(removed for saving gas) uint48 orderId; //0:not exist; start from 1
        uint48 beforeOrderId; //0:this is the top order
        uint48 afterOrderId; //0:this is the last order
        address owner;

        //uses single storage slot
        uint112 amountIn; //token deposit in
        uint112 amountOut; //want token out
        uint32 progress; // progress/type(uint32).max is the progress[0, 1], if amountIn is a large number, precision will be decreased
        //(removed for saving gas) bool isDone; //beforeOrderId==type(uint48).max means removed(done)
    }

    mapping (uint48 => Order) public buyOrders; //orderId => Order
    uint48 public topBuyOrderId; //0:buyOrders is empty

    mapping (uint48 => Order) public sellOrders; //orderId => Order
    uint48 public topSellOrderId; //0:sellOrders is empty


    constructor(address token0Addr, address token1Addr, uint8 _fee) {
        token0 = IERC20(token0Addr);
        token1 = IERC20(token1Addr);
        fee = _fee;
        feeTo = msg.sender;
    }

    function getBuyOrder(uint48 orderId) public view returns (Order memory) {
        return buyOrders[orderId];
    }

    function getSellOrder(uint48 orderId) public view returns (Order memory) {
        return sellOrders[orderId];
    }

    ///////////////Buy Order////////////

    function makeBuyOrder(uint112 token1In, uint112 token0Out, uint48 beforeOrderId) public returns (uint48) {
        require(token1In > 0, "token1In amount cannot be 0");
        require(token0Out > 0, "token0Out amount cannot be 0");
        token1.transferFrom(msg.sender, address(this), uint(token1In));

        ++count;

        //if buyOrders is empty
        if (topBuyOrderId == 0) {
            buyOrders[count] = Order(0, 0, msg.sender, token1In, token0Out, 0);
            topBuyOrderId = count;
            return count;
        }

        //if newOrder is the new topOrder
        if (beforeOrderId == 0) {
            Order storage topOrder = buyOrders[topBuyOrderId];
            require(topOrder.amountOut * uint(token1In) > topOrder.amountIn * uint(token0Out), "your price must > topOrder");

            topOrder.beforeOrderId = count;
            buyOrders[count] = Order(0, topBuyOrderId, msg.sender, token1In, token0Out, 0);
            topBuyOrderId = count;
            return count;
        }

        Order storage beforeOrder = buyOrders[beforeOrderId];
        require(beforeOrder.amountIn != 0, "beforeOrder is not exist");
        require(beforeOrder.beforeOrderId != type(uint48).max, "beforeOrder is removed(done)");
        require(beforeOrder.amountOut * uint(token1In) <= beforeOrder.amountIn * uint(token0Out), "your price must <= beforeOrder");

        //if newOrder is the new lastOrder
        if (beforeOrder.afterOrderId == 0) {
            beforeOrder.afterOrderId = count;
            buyOrders[count] = Order(beforeOrderId, 0, msg.sender, token1In, token0Out, 0);
            return count;
        }

        //if beforeOrder and afterOrder both exist
        Order storage afterOrder = buyOrders[beforeOrder.afterOrderId];
        require(afterOrder.amountIn != 0, "afterOrder is not exist");
        require(afterOrder.beforeOrderId != type(uint48).max, "afterOrder is removed(done)");
        require(afterOrder.amountOut * uint(token1In) > afterOrder.amountIn * uint(token0Out), "your price must > afterOrder");

        buyOrders[count] = Order(beforeOrderId, beforeOrder.afterOrderId, msg.sender, token1In, token0Out, 0);
        beforeOrder.afterOrderId = count;
        afterOrder.beforeOrderId = count;
        return count;
    }

    function takeBuyOrder(uint112 token0In, uint112 token1Want) public returns (uint112 token0Pay, uint112 token1Gain, uint112 token0Fee) {
        require(topBuyOrderId != 0, "buyOrders is empty");

        token0.transferFrom(msg.sender, address(this), uint(token0In));

        uint112 takerToken0Left = token0In;

        //topOrder.amountOut - WETH
        //topOrder.amountIn - USDT

        while (topBuyOrderId != 0) {
            Order storage topOrder = buyOrders[topBuyOrderId];
            if (uint(token0In) * topOrder.amountIn < uint(token1Want) * topOrder.amountOut ) {
                break; //price not good
            }
            uint112 amountInUsed = uint112(uint(topOrder.progress) * topOrder.amountIn / type(uint32).max);
            uint112 topOrderToken0Left = topOrder.amountOut - uint112(uint(amountInUsed) * topOrder.amountOut / topOrder.amountIn);

            if (takerToken0Left >= topOrderToken0Left) { //completely take the order
                takerToken0Left -= topOrderToken0Left;
                token1Gain += (topOrder.amountIn - amountInUsed);

                //topOrder is done
                _removeOrderLink(topOrder, buyOrders);
                topOrder.progress = type(uint32).max;
                token0.transfer(topOrder.owner, uint(topOrderToken0Left));
                topOrder.beforeOrderId = type(uint48).max;

                // console.log("done, amountOut:", topOrderToken0Left);
                topBuyOrderId = topOrder.afterOrderId; //continue loop

            } else {  //partly take the order
                uint112 deltaToken1Gain = uint112(uint(takerToken0Left) * topOrder.amountIn / topOrder.amountOut);
                token1Gain += deltaToken1Gain;

                //topOrder is partly done
                amountInUsed += deltaToken1Gain;
                topOrder.progress = uint32(amountInUsed * type(uint32).max / topOrder.amountIn) + 1;
                // console.log("partly take buyOrder, amountInUsed:", amountInUsed, topOrder.progress, takerToken0Left);
                token0.transfer(topOrder.owner, takerToken0Left);

                // console.log("partly done, takerToken0Left:", takerToken0Left);
                takerToken0Left = 0;
                break;
            }
        }

        token0Pay = token0In - takerToken0Left;
        require(token0Pay > 0, "no deal");

        token0Fee = token0Pay * uint112(fee) / 10000;
        if (token0Fee > 0) {
            token0.transferFrom(msg.sender, feeTo, uint(token0Fee));
        }
        if (takerToken0Left > 0) {
            token0.transfer(msg.sender, uint(takerToken0Left));
        }
        if (token1Gain > 0) {
            token1.transfer(msg.sender, uint(token1Gain));
        }
    }

    function cancelBuyOrder(uint48 orderId) public returns (uint112 token1Left) {
        Order storage order = buyOrders[orderId];
        require(order.owner == msg.sender, "you are not owner of the order");
        require(order.beforeOrderId != type(uint48).max, "the order is already removed(done)");

        _removeOrderLink(order, buyOrders);
        if (topBuyOrderId == orderId) {
            topBuyOrderId = order.afterOrderId;
        }
        order.beforeOrderId = type(uint48).max;

        uint112 amountInUsed = uint112(uint(order.progress) * order.amountIn / type(uint32).max);
        // console.log("cancelBuyOrder amountInUsed:", amountInUsed, order.progress);
        token1Left = order.amountIn - amountInUsed;
        if (token1Left > 0) {
            token1.transfer(order.owner, uint(token1Left));
        }
    }

    function changeBuyOrderOwner(uint48 orderId, address newOwner) public {
        Order storage order = buyOrders[orderId];
        require(order.owner == msg.sender, "you are not owner of the order");
        require(order.beforeOrderId != type(uint48).max, "the order is already removed(done)");
        require(newOwner != address(0), "newOwner can't be address(0)");

        order.owner = newOwner;
    }

    ///////////////Sell Order////////////

    function makeSellOrder(uint112 token0In, uint112 token1Out, uint48 beforeOrderId) public returns (uint48) {
        require(token0In > 0, "token0In amount cannot be 0");
        require(token1Out > 0, "token1Out amount cannot be 0");
        token0.transferFrom(msg.sender, address(this), uint(token0In));

        ++count;

        //if sellOrders is empty
        if (topSellOrderId == 0) {
            sellOrders[count] = Order(0, 0, msg.sender, token0In, token1Out, 0);
            topSellOrderId = count;
            return count;
        }

        //if newOrder is the new topOrder
        if (beforeOrderId == 0) {
            Order storage topOrder = sellOrders[topSellOrderId];
            require(topOrder.amountOut * uint(token0In) > topOrder.amountIn * uint(token1Out), "your price must < topOrder");

            topOrder.beforeOrderId = count;
            sellOrders[count] = Order(0, topSellOrderId, msg.sender, token0In, token1Out, 0);
            topSellOrderId = count;
            return count;
        }

        Order storage beforeOrder = sellOrders[beforeOrderId];
        require(beforeOrder.amountIn != 0, "beforeOrder is not exist");
        require(beforeOrder.beforeOrderId != type(uint48).max, "beforeOrder is removed(done)");
        require(beforeOrder.amountOut * uint(token0In) <= beforeOrder.amountIn * uint(token1Out), "your price must >= beforeOrder");

        //if newOrder is the new lastOrder
        if (beforeOrder.afterOrderId == 0) {
            beforeOrder.afterOrderId = count;
            sellOrders[count] = Order(beforeOrderId, 0, msg.sender, token0In, token1Out, 0);
            return count;
        }

        //if beforeOrder and afterOrder both exist
        Order storage afterOrder = sellOrders[beforeOrder.afterOrderId];
        require(afterOrder.amountIn != 0, "afterOrder is not exist");
        require(afterOrder.beforeOrderId != type(uint48).max, "afterOrder is removed(done)");
        require(afterOrder.amountOut * uint(token0In) > afterOrder.amountIn * uint(token1Out), "your price must < afterOrder");

        sellOrders[count] = Order(beforeOrderId, beforeOrder.afterOrderId, msg.sender, token0In, token1Out, 0);
        beforeOrder.afterOrderId = count;
        afterOrder.beforeOrderId = count;
        return count;
    }

    function takeSellOrder(uint112 token1In, uint112 token0Want) public returns (uint112 token1Pay, uint112 token0Gain, uint112 token1Fee) {
        require(topSellOrderId != 0, "sellOrders is empty");

        token1.transferFrom(msg.sender, address(this), token1In);

        uint112 takerToken1Left = token1In;

        //topOrder.amountOut - USDT
        //topOrder.amountIn - WETH

        while (topSellOrderId != 0) {
            Order storage topOrder = sellOrders[topSellOrderId];
            if (uint(token1In) * topOrder.amountIn < uint(token0Want) * topOrder.amountOut ) {
                break; //price not good
            }
            uint112 amountInUsed = uint112(uint(topOrder.progress) * topOrder.amountIn / type(uint32).max);
            uint112 topOrderToken1Left = topOrder.amountOut - uint112(uint(amountInUsed) * topOrder.amountOut / topOrder.amountIn);

            if (takerToken1Left >= topOrderToken1Left) { //completely take the order
                takerToken1Left -= topOrderToken1Left;
                token0Gain += (topOrder.amountIn - amountInUsed);

                //topOrder is done
                _removeOrderLink(topOrder, sellOrders);
                topOrder.progress = type(uint32).max;
                token1.transfer(topOrder.owner, uint(topOrderToken1Left));
                topOrder.beforeOrderId = type(uint48).max;

                // console.log("done, amountOut:", topOrderToken1Left);
                topSellOrderId = topOrder.afterOrderId; //continue loop

            } else {  //partly take the order
                uint112 deltaToken0Gain = uint112(uint(takerToken1Left) * topOrder.amountIn / topOrder.amountOut);
                token0Gain += deltaToken0Gain;

                //topOrder is partly done
                amountInUsed += deltaToken0Gain;
                topOrder.progress = uint32(amountInUsed * type(uint32).max / topOrder.amountIn) + 1;
                // console.log("partly take sellOrder, amountInUsed:", amountInUsed, topOrder.progress, takerToken1Left);
                token1.transfer(topOrder.owner, uint(takerToken1Left));

                // console.log("partly done, takerToken1Left:", takerToken1Left, token0Gain);
                takerToken1Left = 0;
                break;
            }
        }

        token1Pay = token1In - takerToken1Left;
        require(token1Pay > 0, "no deal");

        token1Fee = token1Pay * uint112(fee) / 10000;
        if (token1Fee > 0) {
            token1.transferFrom(msg.sender, feeTo, uint(token1Fee));
        }
        if (takerToken1Left > 0) {
            token1.transfer(msg.sender, uint(takerToken1Left));
        }
        if (token0Gain > 0) {
            token0.transfer(msg.sender, uint(token0Gain));
        }
    }

    function cancelSellOrder(uint48 orderId) public returns (uint112 token0Left) {
        Order storage order = sellOrders[orderId];
        require(order.owner == msg.sender, "you are not owner of the order");
        require(order.beforeOrderId != type(uint48).max, "the order is already removed(done)");

        _removeOrderLink(order, sellOrders);
        if (topSellOrderId == orderId) {
            topSellOrderId = order.afterOrderId;
        }
        order.beforeOrderId = type(uint48).max;

        uint112 amountInUsed = uint112(uint(order.progress) * order.amountIn / type(uint32).max);
        // console.log("cancelSellOrder amountInUsed:", amountInUsed, order.progress);
        token0Left = order.amountIn - amountInUsed;
        if (token0Left > 0) {
            token0.transfer(order.owner, uint(token0Left));
        }
    }

    function changeSellOrderOwner(uint48 orderId, address newOwner) public {
        Order storage order = sellOrders[orderId];
        require(order.owner == msg.sender, "you are not owner of the order");
        require(order.beforeOrderId != type(uint48).max, "the order is already removed(done)");

        order.owner = newOwner;
    }

    function _removeOrderLink(Order storage order, mapping (uint48 => Order) storage orders) internal {
        if (order.beforeOrderId != 0) {
            orders[order.beforeOrderId].afterOrderId = order.afterOrderId;
        }
        if (order.afterOrderId != 0) {
            orders[order.afterOrderId].beforeOrderId = order.beforeOrderId;
        }
    }

}

contracts/MarsService.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./MarsPair.sol";
import "hardhat/console.sol";

/**
 * @title MarsService
 * @author JXRow
 * @notice for UI use, insead of back-end
 */
contract MarsService {

    //for BuyList and SellList
    struct ListOrder {
        uint48 orderId;
        uint112 amountIn;
        uint112 amountOut;
        uint32 progress;
    }

    //UserOrder combine OrderCreate and MarsPair.Order
    struct UserOrder {
        address pair;
        uint48 orderId;
        uint32 createTime;
        bool isBuy;
        address owner;
        uint112 amountIn;
        uint112 amountOut;
        uint32 progress;
        bool isRemoved;
    }

    struct OrderCreate {
        address pair;
        uint48 orderId;
        uint32 createTime;
        bool isBuy;
    }

    //store user's order list, include all pairs
    //bytes.concat(bytes20(uint160(user)), bytes6(index)) => OrderCreate
    mapping (bytes26 => OrderCreate) orderCreates;

    //store the length of user's order list, 
    mapping (address => uint48) userOrdersLength;

    constructor() {
    }


    ////////////////////////
    ///////// view /////////
    ////////////////////////

    function getBuyList(address pairAddr, uint48 fromOrderId, uint8 num) external view returns (ListOrder[] memory) {
        ListOrder[] memory result = new ListOrder[](num);
        MarsPair pair = MarsPair(pairAddr);

        if (fromOrderId == 0) {
            fromOrderId = pair.topBuyOrderId();
        }

        MarsPair.Order memory pairOrder = pair.getBuyOrder(fromOrderId);
        result[0] = ListOrder(fromOrderId, pairOrder.amountIn, pairOrder.amountOut, pairOrder.progress);
        for (uint8 i = 1; i < num; i++) {
            uint48 orderId = pairOrder.afterOrderId;
            pairOrder = pair.getBuyOrder(orderId);
            result[i] = ListOrder(orderId, pairOrder.amountIn, pairOrder.amountOut, pairOrder.progress);
        }
        return result;
    }

    function getSellList(address pairAddr, uint48 fromOrderId, uint8 num) external view returns (ListOrder[] memory) {
        ListOrder[] memory result = new ListOrder[](num);
        MarsPair pair = MarsPair(pairAddr);

        if (fromOrderId == 0) {
            fromOrderId = pair.topSellOrderId();
        }

        MarsPair.Order memory pairOrder = pair.getSellOrder(fromOrderId);
        result[0] = ListOrder(fromOrderId, pairOrder.amountIn, pairOrder.amountOut, pairOrder.progress);
        for (uint8 i = 1; i < num; i++) {
            uint48 orderId = pairOrder.afterOrderId;
            pairOrder = pair.getSellOrder(orderId);
            result[i] = ListOrder(orderId, pairOrder.amountIn, pairOrder.amountOut, pairOrder.progress);
        }
        return result;
    }

    function getUserOrders(address user, uint48 startIndex, uint48 num) external view returns (UserOrder[] memory) {
        UserOrder[] memory orders = new UserOrder[](num);

        if (startIndex == 0) {
            startIndex = userOrdersLength[user];
        }
        if (startIndex == 0) {
            return orders;
        }

        for (uint48 index = startIndex; startIndex - index < num; --index) {
            OrderCreate memory orderCreate = orderCreates[_encodeAddressUint48(user, index)];
            MarsPair.Order memory pairOrder = _getPairOrder(orderCreate.pair, orderCreate.orderId, orderCreate.isBuy);
            orders[startIndex - index] = _combineUserOrder(orderCreate, pairOrder);
        }
        return orders;
    }

    function _getPairOrder(address pairAddr, uint48 orderId, bool isBuy) internal view returns (MarsPair.Order memory) {
        return isBuy ? MarsPair(pairAddr).getBuyOrder(orderId) : MarsPair(pairAddr).getSellOrder(orderId);
    }

    function _encodeAddressUint48(address addr, uint48 u48) internal pure returns (bytes26) {
        return bytes26(bytes.concat(bytes20(uint160(addr)), bytes6(u48)));
    }

    function _decodeAddressUint48(bytes26 b26) internal pure returns (address addr, uint48 u48) {
        addr = address(uint160(bytes20(b26)));
        u48 = uint48(uint208(b26));
    }

    function _combineUserOrder(OrderCreate memory orderCreate, MarsPair.Order memory pairOrder) internal pure returns (UserOrder memory) {
        return UserOrder(
            orderCreate.pair,
            orderCreate.orderId,
            orderCreate.createTime,
            orderCreate.isBuy,
            pairOrder.owner,
            pairOrder.amountIn,
            pairOrder.amountOut,
            pairOrder.progress,
            pairOrder.beforeOrderId == type(uint48).max
        );
    }

    function _addOrderCreate(address pairAddr, uint48 newOrderId, bool isBuy) internal {
        uint48 index = userOrdersLength[msg.sender];
        index++;
        orderCreates[_encodeAddressUint48(msg.sender, index)] =  OrderCreate(pairAddr, newOrderId, uint32(block.timestamp), isBuy);
        userOrdersLength[msg.sender] = index;
    }


    ////////////////////////
    ///////// buy /////////
    ////////////////////////

    function _findBeforeOrderIdInBuyList(address pairAddr, uint112 token1In, uint112 token0Out, uint48 findFromId) view internal returns (uint48) {
        MarsPair pair = MarsPair(pairAddr);
        uint48 id = pair.topBuyOrderId();

        if (id == 0) {
            return 0;
        }

        if (findFromId == 0) {
            findFromId = id;
        }

        (uint48 beforeOrderId, uint48 afterOrderId, , uint112 amountIn, uint112 amountOut, ) = pair.buyOrders(findFromId);
        if (amountIn != 0 && beforeOrderId != type(uint48).max) {
            id = findFromId;
        }

        while (true) {
            if (amountOut * token1In > amountIn * token0Out) {
                return beforeOrderId;
            }
            if (afterOrderId == 0) {
                return id;
            } else {
                id = afterOrderId;
            }
            (beforeOrderId, afterOrderId, , amountIn, amountOut, ) = pair.buyOrders(id);
        }

        return type(uint48).max;
    }

    //if beforeOrder not exist, auto find BeforeOrderId
    function makeBuyOrder(address pairAddr, uint112 token1In, uint112 token0Out, uint48 beforeOrderId) external returns (uint48 newOrderId) {
        MarsPair pair = MarsPair(pairAddr);

        IERC20 token1 = pair.token1();
        token1.transferFrom(msg.sender, address(this), token1In);
        if (token1.allowance(address(this), pairAddr) < token1In) {
            token1.approve(pairAddr, type(uint).max);
        }

        uint48 pairBeforeOrderId = _findBeforeOrderIdInBuyList(pairAddr, token1In, token0Out, beforeOrderId);
        newOrderId = pair.makeBuyOrder(token1In, token0Out, pairBeforeOrderId);
        pair.changeBuyOrderOwner(newOrderId, msg.sender);

        _addOrderCreate(pairAddr, newOrderId, true);
    }

    //Experience like CEX, if partly done, the left makes sell order
    function takeBuyOrder(address pairAddr, uint112 token0In, uint112 token1Want) external returns (uint112 token0Pay, uint112 token1Gain, uint112 token0Fee) {
        MarsPair pair = MarsPair(pairAddr);
        IERC20 token0 = pair.token0();

        uint112 fullFee = token0In * pair.fee() / 10000;
        uint112 token0InWithFee = fullFee + token0In;
        token0.transferFrom(msg.sender, address(this), token0InWithFee);
        if (token0.allowance(address(this), pairAddr) < token0InWithFee) {
            token0.approve(pairAddr, type(uint).max);
        }

        (token0Pay, token1Gain, token0Fee) = pair.takeBuyOrder(token0In, token1Want);
        pair.token1().transfer(msg.sender, token1Gain);
        if (fullFee > token0Fee) {
            token0.transfer(msg.sender, fullFee - token0Fee); //give back
        }

        //make sell order
        if (token0In > token0Pay) {
            uint112 newToken0In = token0In - token0Pay;
            uint112 newToken1Want = newToken0In * token1Want / token0In;

            uint48 beforeOrderId = _findBeforeOrderIdInSellList(pairAddr, newToken0In, newToken1Want, 0);
            uint48 newOrderId = pair.makeSellOrder(newToken0In, newToken1Want, beforeOrderId);
            pair.changeSellOrderOwner(newOrderId, msg.sender);
        }
    }

    //Experience like CEX, if partly done, the left give back
    function takeBuyOrder2(address pairAddr, uint112 token0In, uint112 token1Want) external returns (uint112 token0Pay, uint112 token1Gain, uint112 token0Fee) {
        MarsPair pair = MarsPair(pairAddr);
        IERC20 token0 = pair.token0();

        uint112 fullFee = token0In * pair.fee() / 10000;
        uint112 token0InWithFee = fullFee + token0In;
        token0.transferFrom(msg.sender, address(this), token0InWithFee);
        if (token0.allowance(address(this), pairAddr) < token0InWithFee) {
            token0.approve(pairAddr, type(uint).max);
        }

        (token0Pay, token1Gain, token0Fee) = pair.takeBuyOrder(token0In, token1Want);
        pair.token1().transfer(msg.sender, token1Gain);

        //give back
        if (token0In > token0Pay) {
            uint112 token0Left = token0In - token0Pay;
            uint112 feeBack = fullFee - token0Fee;
            token0.transfer(msg.sender, token0Left + feeBack); //give back
        }
    }


    ////////////////////////
    ///////// sell /////////
    ////////////////////////

    function _findBeforeOrderIdInSellList(address pairAddr, uint112 token0In, uint112 token1Out, uint48 findFromId) view internal returns (uint48) {
        MarsPair pair = MarsPair(pairAddr);
        uint48 id = pair.topSellOrderId();

        if (id == 0) {
            return 0;
        }

        if (findFromId == 0) {
            findFromId = id;
        }

        (uint48 beforeOrderId, uint48 afterOrderId, , uint112 amountIn, uint112 amountOut, ) = pair.sellOrders(findFromId);
        if (amountIn != 0 && beforeOrderId != type(uint48).max) {
            id = findFromId;
        }

        while (true) {
            if (amountOut * token0In > amountIn * token1Out) {
                return beforeOrderId;
            }
            if (afterOrderId == 0) {
                return id;
            } else {
                id = afterOrderId;
            }
            (beforeOrderId, afterOrderId, , amountIn, amountOut, ) = pair.sellOrders(id);
        }

        return type(uint48).max;
    }

